e.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deutschland)\\\\\\\" title=\\\\\\\"BetÃ¤ubungsmittelgesetz (Deutschland)\\\\\\\">deutschen BetÃ¤ubungsmittelgesetz</a> (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu <span class=\\\\\\\"plainlinks-print\\\\\\\"><a rel=\\\\\\\"nofollow\\\\\\\" class=\\\\\\\"external text\\\\\\\" href=\\\\\\\"https://www.gesetze-im-internet.de/btmg_1981/__1.html\\\\\\\">Â§Â 1</a></span>\\\\r\\\\n Abs.Â 1 BtMG aufgelistet sind, als BetÃ¤ubungsmittel bezeichnet. Anbau, \\\\r\\\\nHerstellung, Handel, Einfuhr, Ausfuhr, Abgabe, VerÃ¤uÃŸerung, \\\\r\\\\nInverkehrbringung und Erwerb, wofÃ¼r eine Erlaubnis nach <span class=\\\\\\\"plainlinks-print\\\\\\\"><a rel=\\\\\\\"nofollow\\\\\\\" class=\\\\\\\"external text\\\\\\\" href=\\\\\\\"https://www.gesetze-im-internet.de/btmg_1981/__3.html\\\\\\\">Â§Â 3</a></span> BtMG notwendig ist, sind in diesem Gesetz geregelt.\\\\r\\\\n</p><p>Die Medizin verwendet bevorzugt den Begriff <a href=\\\\\\\"https://de.wikipedia.org/wiki/An%C3%A4sthetikum\\\\\\\" title=\\\\\\\"AnÃ¤sthetikum\\\\\\\">AnÃ¤sthetikum</a>.\\\\r\\\\n Damit bezeichnet man Medikamente, die zur Erzeugung einer AnÃ¤sthesie \\\\r\\\\n(Zustand einer Empfindungslosigkeit â€“ ob Ã¶rtlich oder allgemein) dienen.\\\\r\\\\nTeilweise Ã¼berschneiden sich der juristische Begriff und der \\\\r\\\\nmedizinische Begriff:\\\\r\\\\n(Beispiel: <a href=\\\\\\\"https://de.wikipedia.org/wiki/Kokain\\\\\\\" title=\\\\\\\"Kokain\\\\\\\">Kokain</a>, unter anderem ein <a href=\\\\\\\"https://de.wikipedia.org/wiki/Lokalan%C3%A4sthetikum\\\\\\\" title=\\\\\\\"LokalanÃ¤sthetikum\\\\\\\">LokalanÃ¤sthetikum</a>, untersteht <a href=\\\\\\\"https://de.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deutschland)\\\\\\\" title=\\\\\\\"BetÃ¤ubungsmittelgesetz (Deutschland)\\\\\\\">betÃ¤ubungsmittelrechtlichen Vorschriften)</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Lidocain\\\\\\\" title=\\\\\\\"Lidocain\\\\\\\">Lidocain</a>\\\\r\\\\n beispielsweise wirkt ebenso lokalanÃ¤sthesierend, untersteht jedoch \\\\r\\\\nkeinen betÃ¤ubungsmittelrechtlichen Vorschriften, da es â€“ im Gegensatz \\\\r\\\\nzur Substanz Kokain â€“ kein signifikantes Missbrauchspotenzial â€“ \\\\r\\\\nbeispielsweise als <a href=\\\\\\\"https://de.wikipedia.org/wiki/Droge\\\\\\\" title=\\\\\\\"Droge\\\\\\\">Rauschdroge</a> â€“ besitzt. \\\\r\\\\nEbenso unterstehen <a href=\\\\\\\"https://de.wikipedia.org/wiki/Opioide\\\\\\\" title=\\\\\\\"Opioide\\\\\\\">Opioide</a>\\\\r\\\\n zum GroÃŸteil dem BetÃ¤ubungsmittelgesetz, da diese â€“ neben einem hohen \\\\r\\\\nMissbrauchspotenzial als Droge, bedingt durch dessen (je nach Substanz \\\\r\\\\nund Applikationsart mehr oder weniger) starke <a href=\\\\\\\"https://de.wikipedia.org/wiki/Psychotrop\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Psychotrop\\\\\\\">psychotrope Wirkung</a> â€“ auch ein keineswegs zu unterschÃ¤tzendes, hohes AbhÃ¤ngigkeitspotenzial besitzen. \\\\r\\\\n<a href=\\\\\\\"https://de.wikipedia.org/wiki/Nichtopioid-Analgetikum\\\\\\\" title=\\\\\\\"Nichtopioid-Analgetikum\\\\\\\">Nichtopioid-Analgetika</a> unterstehen im Regelfall keinen betÃ¤ubungsmittelrechtlichen Vorschriften (<a href=\\\\\\\"https://de.wikipedia.org/wiki/Ibuprofen\\\\\\\" title=\\\\\\\"Ibuprofen\\\\\\\">Ibuprofen</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Acetylsalicyls%C3%A4ure\\\\\\\" title=\\\\\\\"AcetylsalicylsÃ¤ure\\\\\\\">AcetylsalicylsÃ¤ure</a>, <a href=\\\\\\\"https://de.wikipedia.org/wiki/Paracetamol\\\\\\\" title=\\\\\\\"Paracetamol\\\\\\\">Paracetamol</a>), da sie nicht oder nur geringfÃ¼gig <a href=\\\\\\\"https://de.wikipedia.org/wiki/Psychotrop\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Psychotrop\\\\\\\">psychotrop</a> wirken und daher kein nennenswerter Missbrauch zu Rauschzwecken mÃ¶glich ist (mit einigen Ausnahmen wie <a href=\\\\\\\"https://de.wikipedia.org/wiki/Ketamin\\\\\\\" title=\\\\\\\"Ketamin\\\\\\\">Ketamin</a>).\\\\r\\\\nEin weiteres Beispiel fÃ¼r BtM sind <a href=\\\\\\\"https://de.wikipedia.org/wiki/Methadon\\\\\\\" title=\\\\\\\"Methadon\\\\\\\">Methadon</a>-Zubereitungen, die in der <a href=\\\\\\\"https://de.wikipedia.org/wiki/Drogenersatztherapie\\\\\\\" class=\\\\\\\"mw-redirect\\\\\\\" title=\\\\\\\"Drogenersatztherapie\\\\\\\">Drogenersatztherapie</a> zum Einsatz kommen und in Apotheken als Rezepturarzneimittel hergestellt werden. Auch Substanzen wie etwa <a href=\\\\\\\"https://de.wikipedia.org/wiki/Amphetamin\\\\\\\" title=\\\\\\\"Amphetamin\\\\\\\">Amphetamin</a>, die nicht betÃ¤ubend, sondern im Gegenteil stark anregend wirken, sind BtM im Sinne des Gesetzes.\\\\r\\\\n</p></div>\\\",\\n  \\\"productclass\\\" : \\\"medicament\\\",\\n  \\\"properties\\\" : \\\"sell\\\",\\n  \\\"price\\\" : 75.0,\\n  \\\"shippingmethod\\\" : \\\"shippinghome\\\",\\n  \\\"stockQuantity\\\" : 100,\\n  \\\"currency\\\" : \\\"EUR\\\",\\n  \\\"ean13\\\" : \\\"\\\",\\n  \\\"shopid\\\" : 201903240100000004,\\n  \\\"languageCode\\\" : \\\"de\\\",\\n  \\\"priceinterval\\\" : \\\"ONCE\\\",\\n  \\\"status\\\" : \\\"WAITING\\\",\\n  \\\"downloadURL\\\" : \\\"/media?id=null\\\",\\n  \\\"tokenid\\\" : \\\"032209fe004faf9d31e90c36f2b29d611147e563ed36bc0cd9f29db7abbaf3f0c3\\\",\\n  \\\"pubkey\\\" : \\\"033e3be06fd10014a7e1aaf5056bf0ff7f133441c3a5a272c5c7b420448c8808bf\\\",\\n  \\\"description140\\\" : \\\"Im deutschen BetÃ¤ubungsmittelgesetz (BtMG) werden alle Stoffe oder Zubereitungen, die in Anlage I bis III zu Â§ 1 Abs. 1 BtMG aufgelistet si\\\",\\n  \\\"productDetail\\\" : \\\"/public/product.jsf?id=201904020100000007\\\",\\n  \\\"candeploy\\\" : false,\\n  \\\"canAddCard\\\" : true,\\n  \\\"token\\\" : true,\\n  \\\"canDownload\\\" : false,\\n  \\\"smallImage\\\" : \\\"/media?id=201904020100000006\\\",\\n  \\\"detail140\\\" : \\\"<br><div><img src=\\\\\\\"/media?id=201904020100000006\\\\\\\"></div><div><p>Im <a href=\\\\\\\"https://de.wikipedia.org/wiki/Bet%C3%A4ubungsmittelgesetz_(Deuts\\\"\\n}\"\n  } ]\n}',NULL,NULL,NULL